import React, { useState } from "react";

const places = [
  {
    name: "Coorg",
    image: "data:image/jpeg;base64,",
  },
  {
    name: "Hampi",
    image: "data:image/jpeg;base64,",
  },
  {
    name: "Mysore",
    image: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTP2j_bZMCaKuvAcpYVy5IP2hJ27qFiXZ9DmQ&usqp=CAU",
  },
  {
    name: "Gokarna",
    image: "data:image/jpeg;base64,",
  },
];

const BookingForm = () => {
  const [destination, setDestination] = useState("");
  const [startDate, setStartDate] = useState("");
  const [endDate, setEndDate] = useState("");
  const [numOfPeople, setNumOfPeople] = useState("");

  const handleDestinationChange = (event) => {
    setDestination(event.target.value);
  };

  const handleStartDateChange = (event) => {
    setStartDate(event.target.value);
  };

  const handleEndDateChange = (event) => {
    setEndDate(event.target.value);
  };

  const handleNumOfPeopleChange = (event) => {
    setNumOfPeople(event.target.value);
  };

  const handleSubmit = (event) => {
    event.preventDefault();
    // Send booking data to backend for processing
  };

  return (
    <div>
      <h2>Popular Places in Karnataka</h2>
      <ul>
        {places.map((place) => (
          <li key={place.name}>
            <img src={place.image} alt={place.name} width="200" height="150" />
            <p>{place.name}</p>
          </li>
        ))}
      </ul>
      <div className="first">
      <h2>Book Your Trip</h2>
      <form onSubmit={handleSubmit}>
        <label htmlFor="destination">Destination:</label>
        <select id="destination" value={destination} onChange={handleDestinationChange}>
          <option value="">Select a destination</option>
          {places.map((place) => (
            <option key={place.name} value={place.name}>
              {place.name}
            </option>
          ))}
        </select>
         <br></br><br></br>
        <label htmlFor="start-date">Start Date:</label><br></br><br></br>
        <input type="date" id="start-date" value={startDate} onChange={handleStartDateChange} /><br></br><br></br>

        <label htmlFor="end-date">End Date:</label><br></br><br></br>
        <input type="date" id="end-date" value={endDate} onChange={handleEndDateChange} /><br></br><br></br>

        <label htmlFor="num-of-people">Number of People:</label><br></br><br></br>
        <input type="number" id="num-of-people" value={numOfPeople} onChange={handleNumOfPeopleChange} /><br></br><br></br>

        <button type="submit">Book Now</button><br></br><br></br>
      </form>
      </div>
    </div>
    
  );
};

export default BookingForm;
